import React, {Component} from "react";
import './Results.css';
import $ from 'jquery';

class Results extends Component{
    render() {
        return(
            <div id="results-section" >
                <hr/>
                <h2 style={{paddingBottom: '100px'}}>Resultados</h2>
               <div className="row" >
                    <div className="col-lg-3">
                        <img className="rounded-circle" width="140" height="140"/>
                        <h2>340</h2>
                        <p>Xícaras de café</p>
                    </div>
                   <div className="col-lg-3">
                       <img className="rounded-circle" width="140" height="140"/>
                       <h2>340</h2>
                       <p>Projetos</p>
                   </div>
                   <div className="col-lg-3">
                       <img className="rounded-circle" width="140" height="140"/>
                       <h2>340</h2>
                       <p>Linhas de Código</p>
                   </div>
                   <div className="col-lg-3">
                       <img className="rounded-circle" width="140" height="140"/>
                       <h2>340</h2>
                       <p>Paixão</p>
                   </div>
               </div>
            </div>
        )
    }
}



$('.count').each(function () {
    $(this).prop('Counter',0).animate({
        Counter: $(this).text()
    }, {
        duration: 4000,
        easing: 'swing',
        step: function (now) {
            $(this).text(Math.ceil(now));
        }
    });
});

export default Results;
